import React from "react";
import QuestionPopUp from "./components/questionPopUp";

export default class App extends React.Component {

  constructor(){
    super();
    this.state = {
      score: 0,
    }
  }

  openPopUp(option){
    this.setState({
      option: option,
      isOpenP
    })
  }

  render() {
    return (
      <>
        <div id="wrap-page">

          <img id="background" src="./assets/images/interface/background_dever.png" loading="lazy" alt="background" />

          <div id="navigation">
            <img id="logo_dever" src="./assets/images/interface/logo_dever_color.png" loading="lazy" alt="logo dever" />
            <img id="logo_fpt" src="./assets/images/interface/logo_fpt.png" loading="lazy" alt="logo fpt university" />
          </div>

          <p id="score">Score: {this.state.score}</p>

          <div id='wrap-select-level'>
            <h3>Select level</h3>
            <div id="levels">
              <div className="level">
                <div onClick={()=>openPopUp(0)} className="decor-level">Level 1</div>
              </div>
              <div className="level">
                <div onClick={()=>openPopUp(1)} className="decor-level">Level 2</div>
              </div>
              <div className="level">
                <div onClick={()=>openPopUp(2)} className="decor-level">Level 3</div>
              </div>
              <div className="level">
                <div onClick={()=>openPopUp(3)} className="decor-level">Level 4</div>
              </div>
              <div className="level">
                <div onClick={()=>openPopUp(4)} className="decor-level">Level 5</div>
              </div>
              <div className="level">
                <div onClick={()=>openPopUp(5)} className="decor-level">Level 6</div>
              </div>
            </div>
          </div>

          <QuestionPopUp level={0} setQues = {Math.random() * 6}/>

        </div>
      </>
    )
  }
}
